import React from 'react';
import { useAuth0 } from "@auth0/auth0-react";

const Profile = () => {
    const { user } = useAuth0();
    var email = user.getString("email");
    return (
        <div>
            {JSON.stringify(user, null, 2)}
            {JSON.stringify(email)}
        </div>
    ) 
}

export default Profile;
